import styles from './Expenseltem.css'

const ExpenseItem = () => {
    return (
        <div className={styles.expense-item}>
            <div>March 28th 2023</div>
            <div className="expense-item__description">
                <h2>Car Insurance</h2>
                <div className="expense-item__price">$294.67</div>
            </div>
        </div>
    );
}

export default ExpenseItem;
